import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

// COPIA Y PEGA TU LOGO EN BASE64 AQUÍ ▼
const logoBase64 = 'data:image/jpeg;base64,';
// EJEMPLO: 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAA...'
// Cambia 'image/png' por 'image/jpeg' si es JPEG

export function exportOrdenPDF(orden: any) {
  if (!orden) return;

  const doc = new jsPDF();
  doc.setFont('helvetica');

  const pageWidth = doc.internal.pageSize.width;
  const pageHeight = doc.internal.pageSize.height;
  let cursorY = 15;

  /* =========================
     HEADER CON LOGO
  ========================= */
  doc.setFillColor(225, 6, 0);
  doc.rect(0, 0, pageWidth, 40, 'F');

  // Agregar logo si existe
  if (logoBase64 && logoBase64.startsWith('data:image')) {
    try {
      doc.addImage(logoBase64, 'PNG', 15, 5, 40, 30);
    } catch (error) {
      console.error('Error cargando logo:', error);
    }
  }

  doc.setTextColor(255);
  doc.setFontSize(26);
  doc.setFont('helvetica', 'bold');
  doc.text('MOTOROOM', pageWidth / 2, 22, { align: 'center' });

  doc.setFontSize(12);
  doc.setFont('helvetica', 'normal');
  doc.text('Taller Mecánico Especializado', pageWidth / 2, 30, { align: 'center' });

  cursorY = 50;

  /* =========================
     TÍTULO ORDEN
  ========================= */
  doc.setTextColor(225, 6, 0);
  doc.setFontSize(18);
  doc.setFont('helvetica', 'bold');
  doc.text(`ORDEN DE SERVICIO #${orden.id}`, pageWidth / 2, cursorY, { align: 'center' });

  cursorY += 10;

  const fecha = new Date(orden.fecha_ingreso || orden.created_at || Date.now());
  const fechaStr = fecha.toLocaleDateString();
  const horaStr = fecha.toLocaleTimeString().slice(0, 5);

  doc.setFontSize(10);
  doc.setFont('helvetica', 'normal');
  doc.setTextColor(0);
  doc.text(`Fecha: ${fechaStr} ${horaStr}`, 15, cursorY);

  /* ===== BADGE ESTADO ===== */
  const estadoColors: { [key: string]: [number, number, number] } = {
    RECIBIDA: [65, 105, 225],
    EN_PROCESO: [255, 140, 0],
    TERMINADA: [50, 205, 50],
    FACTURADA: [139, 0, 0],
  };

  const estadoColor = (estadoColors[orden.estado] || [128, 128, 128]) as [number, number, number];
  doc.setFillColor(...estadoColor);
  doc.roundedRect(pageWidth - 55, cursorY - 5, 40, 8, 4, 4, 'F');
  doc.setTextColor(255);
  doc.setFontSize(9);
  doc.text(orden.estado?.replace('_', ' ') || 'N/A', pageWidth - 35, cursorY, { align: 'center' });

  cursorY += 15;

  /* =========================
     FUNCIÓN CAJA DINÁMICA
  ========================= */
  const drawBox = (title: string, lines: string[]) => {
    const lineHeight = 5;
    const padding = 6;
    const height = padding * 2 + lines.length * lineHeight;

    if (cursorY + height > pageHeight - 40) {
      doc.addPage();
      cursorY = 20;
    }

    doc.setDrawColor(225, 6, 0);
    doc.rect(14, cursorY, pageWidth - 28, height);

    doc.setFontSize(11);
    doc.setFont('helvetica', 'bold');
    doc.setTextColor(225, 6, 0);
    doc.text(title, 18, cursorY + 6);
    doc.line(18, cursorY + 7, pageWidth - 30, cursorY + 7);

    doc.setFontSize(9);
    doc.setFont('helvetica', 'normal');
    doc.setTextColor(0);

    lines.forEach((l, i) => {
      doc.text(l, 18, cursorY + 13 + i * lineHeight);
    });

    cursorY += height + 8;
  };

  /* =========================
     CLIENTE
  ========================= */
  drawBox('CLIENTE', [
    `Nombre: ${orden.cliente?.nombre || 'N/A'}`,
    `Teléfono: ${orden.cliente?.telefono || 'N/A'}`,
    `Email: ${orden.cliente?.email || 'N/A'}`,
    `Identificación: ${orden.cliente?.identificacion || 'N/A'}`,
  ]);

  /* =========================
     VEHÍCULO
  ========================= */
  drawBox('VEHÍCULO', [
    `Placa: ${orden.vehiculo?.placa || 'N/A'}`,
    `Marca: ${orden.vehiculo?.marca || 'N/A'}`,
    `Modelo: ${orden.vehiculo?.modelo || 'N/A'}`,
    `Año: ${orden.vehiculo?.anio || orden.vehiculo?.year || 'N/A'}`,
  ]);

  /* =========================
     MECÁNICO
  ========================= */
  drawBox('MECÁNICO RESPONSABLE', [
    orden.mecanico?.nombre || 'N/A',
  ]);

  /* =========================
     OBSERVACIONES
  ========================= */
  if (orden.observaciones) {
    const lines = doc.splitTextToSize(orden.observaciones, pageWidth - 40);
    drawBox('OBSERVACIONES', lines);
  }

  /* =========================
     DETALLES DEL SERVICIO
  ========================= */
  if (cursorY + 40 > pageHeight) {
    doc.addPage();
    cursorY = 20;
  }

  doc.setFontSize(12);
  doc.setFont('helvetica', 'bold');
  doc.setTextColor(225, 6, 0);
  doc.text('DETALLES DEL SERVICIO', 14, cursorY);
  doc.line(14, cursorY + 1, pageWidth - 14, cursorY + 1);

  cursorY += 6;

  const detalles = orden.detalles || [];

  autoTable(doc, {
    startY: cursorY,
    head: [['#', 'DESCRIPCIÓN', 'CANT.', 'PRECIO', 'SUBTOTAL']],
    body: detalles.length
      ? detalles.map((d: any, i: number) => [
          i + 1,
          d.descripcion,
          d.cantidad,
          `$${Number(d.precio_unitario).toFixed(2)}`,
          `$${(d.cantidad * Number(d.precio_unitario)).toFixed(2)}`,
        ])
      : [['', 'No hay detalles registrados', '', '', '']],
    styles: {
      fontSize: 8,
      cellPadding: 4,
    },
    headStyles: {
      fillColor: [225, 6, 0],
      textColor: 255,
    },
    margin: { left: 14, right: 14 },
  });

  cursorY = (doc as any).lastAutoTable.finalY + 10;

  /* =========================
     TOTAL
  ========================= */
  const total = detalles.reduce(
    (s: number, d: any) => s + d.cantidad * Number(d.precio_unitario),
    0
  );

  if (cursorY + 30 > pageHeight) {
    doc.addPage();
    cursorY = 20;
  }

  doc.setFillColor(255, 245, 245);
  doc.rect(pageWidth - 90, cursorY, 75, 20, 'F');
  doc.setDrawColor(225, 6, 0);
  doc.rect(pageWidth - 90, cursorY, 75, 20);

  doc.setFontSize(12);
  doc.setFont('helvetica', 'bold');
  doc.setTextColor(0);
  doc.text('TOTAL:', pageWidth - 85, cursorY + 8);

  doc.setFontSize(16);
  doc.setTextColor(225, 6, 0);
  doc.text(`$${total.toFixed(2)}`, pageWidth - 20, cursorY + 14, { align: 'right' });

  /* =========================
     FOOTER CON LOGO
  ========================= */
  const pages = doc.getNumberOfPages();
  for (let i = 1; i <= pages; i++) {
    doc.setPage(i);
    
    // Logo pequeño en el footer
    if (logoBase64 && logoBase64.startsWith('data:image')) {
      try {
        doc.addImage(logoBase64, 'PNG', 15, pageHeight - 15, 15, 7);
      } catch (error) {
        console.error('Error cargando logo footer:', error);
      }
    }
    
    doc.setFontSize(7);
    doc.setTextColor(150);
    doc.text(
      `Página ${i} de ${pages} • MOTOROOM Taller Mecánico`,
      pageWidth / 2,
      pageHeight - 8,
      { align: 'center' }
    );
  }

  doc.save(`MOTOROOM_Orden_${orden.id}_${fechaStr.replace(/\//g, '-')}.pdf`);
}